"use strict";var countDate=new Date("May 5, 2020 00:00:00").getTime();function newCourse(){var e=(new Date).getTime(),t=countDate-e,n=36e5,o=Math.floor(t/864e5),r=Math.floor(t%864e5/n),a=Math.floor(t%n/6e4),u=Math.floor(t%6e4/1e3);document.getElementById("day").innerText=o,document.getElementById("hour").innerText=r,document.getElementById("minute").innerText=a,document.getElementById("second").innerText=u}setInterval(function(){newCourse()},1e3);